import React, { Component } from 'react'

class Todo extends Component {
    constructor() {
        super();
        this.state= {
        list : ['Mango','Apple','Orange']
        };

    }


    render() {
        return (
            <div>
                <h1>To-do List</h1>
                <input type='text' id='name' placeholder='Name' />
                <button className='btn btn-outline-success'>Add</button><br /><br />
                <li>{this.state.list}<button className='btn btn-outline-info'>Delete</button></li>

            </div>
        )
    }
}

export default Todo;
